protected void Page_Load(object sender, EventArgs e)\n{\n    if (!IsPostBack)\n    {\n        string xamlContent = GenerateXamlFromData();\n        ClientScript.RegisterStartupScript(this.GetType(), "SetXaml", $"setXaml('{xamlContent}');", true);\n    }\n}\n\nprotected string GenerateXamlFromData()\n{\n    // Logic to generate XAML based on your data\n    return "<TextBlock xmlns=\"http://schemas.microsoft.com/client/2007\" FontSize=\"16\">Generated XAML Content</TextBlock>";\n}